// Proj.js
import React, { useState, useEffect } from 'react';
import './Proj.scss';

import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate
} from 'react-router-dom';

import Header from './Header/Header';
import Footer from './Footer/Footer';
import Dashboard from './Dashboard/Dashboard';
import LoginPage from './LoginPage/LoginPage';
import StartPage from './StartPage/StartPage';
import SignupPage from './SignupPage/SignupPage';
import NewCategory from './NewCategory/NewCategory';

// PrivateRoute component
const PrivateRoute = ({ isAuthenticated, element, ...rest }) => {

  console.log('in function:', authenticated);
  if (isAuthenticated) {
    return element;
  } else {
    return <Navigate to="/login" replace />;
  }
};

function Proj() {
  const [authenticated, setAuthenticated] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem('jwt');
    console.log('token in proj:', token);
    if (token) {
      setAuthenticated(true);
    }
  }, []);

  useEffect(() => {
    console.log('HJJ:', authenticated);
  }, [authenticated]);

  console.log('Authenticated:', authenticated);

  return (
    <Router>
      <div className="mainContainer">
        <Header />
        <Routes>
          <Route path="/" element={<StartPage />} />
          <Route
            path="/login"
            element={<LoginPage setAuthenticated={setAuthenticated} />}
          />
          <Route path="/signup" element={<SignupPage />} />
          <Route
            path="/dashboard"
            element={
              <PrivateRoute isAuthenticated={authenticated} element={<Dashboard />} />
            }
          />
          <Route
            path="/newcategory"
            element={
              <PrivateRoute isAuthenticated={authenticated} element={<NewCategory />} />
            }
          />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default Proj;
